import React from "react"

export default function GridElement(props) {
    if (props.id.includes("SP-")) {
        return <div className={"react-grid-space " + (props.selected)?"grid-selected":""} key={props.id}></div>
    } else {
        return <div className={(props.selected)?"grid-selected":""} key={props.id}>Element</div>
    }
}
